import React from 'react';
import CarService from '../services/CarService';

class CarComponent extends React.Component{
    
    constructor(props){
        super(props);
        this.state={
            cars: []
        }
    }

    componentDidMount(){
        fetch('http://localhost:8081/warehouse/cars').then(cars => cars.json());
    }

    render(){
        return(
        <div>
            <h1 >Car List</h1>
            <table>
                <thead>
                    <tr>
                        <td> car id </td>
                        <td> car name </td>
                    </tr>
                </thead>
                <tbody>
                    {
                        this.state.cars.map(
                            car =>
                            <tr key={car.id}>
                                <td>{car.id}</td>
                                <td>{car.name}</td>
                            </tr>
                        )
                    }
                </tbody>
            </table>
        </div>
        );
    }
}

export default new CarComponent();
